import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
// import {Link} from 'router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';

export class Navigation extends Component {
    constructor(props) {
      super(props);
    }
    render() {
      return (
        <div className="Navbar">
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">EmPoweringKnowledge</NavbarBrand>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/about/">About</NavLink>
              </NavItem>
              <NavItem>
                <NavLink tag={NavLink} to="/representatives">Representatives</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/about/">State</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/about/">Energy Bills</NavLink>
              </NavItem>
         
            </Nav>
        </Navbar>
      
        <header className="App-header">
            EmPoweringKnowledge offers information on different types of energy consumption in each state, 
            in combination with Congress membersâ€™ sponsorship and voting for energy-related bills.
          
        </header>
      
        
      </div>
      );
    }
}

export default Navigation;
